import 'package:test/test.dart';
import 'package:plate_waste_recorder/Model/string_image_converter.dart';
import 'dart:io';

void main(){
  group("image conversions",(){
    test("convert images to and from strings",(){
      // define a test base 64 image string to use
      String testImageString = "";
      convertStringToImage(testImageString, "testimagefile.png");
      expect(File("testimagefile.png").existsSync(),true);

      expect(convertImageToString("testimagefile.png"),testImageString);
    });
  });
}